import React from 'react'
import { Box, Typography } from '@mui/material'

const Header = () => {
    return (
        <Box sx={{
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center'
        }}>
            <Typography>Fitness Tracker</Typography>
        </Box>
    )
}

export default Header
